import React from "react";
import {Link} from 'react-router-dom'

function Login() {


  
  return (
    <div>
        <Link to="/registration">New? Register Here</Link>
        <input type="text"/>
        <input type="password" />

        <button>Login</button>
    </div>
  );
}

export default Login;
